function Projects(props) {
    return (
        <>
            <div className="container mx-auto py-28 px-10 sm:pl-0 md:pl-80 lg:md:pl-80">
                <div className="grid grid-flow-cols grid-cols-1 sm:grid-cols-4 md:grid-cols-4 lg:grid-cols-4 gap-8 pt-10">
                    <div>
                        <img src={props.img} alt="Dribble Desigen" className="w-80 bg-gray-200 py-1 px-1 img-box" />
                        <a href="https://fervent-fermi-c83da0.netlify.app" className="text-xs text-gray-300 border-p" target="_blank">{props.heading}</a>
                    </div>
                </div>
            </div>
        </>
    );
}
export default Projects;
